// FlightInput.js

import React from 'react';

const FlightInput = () => {
  const handleFlightInputChange = (e) => {
    // Handle changes in the flight input textbox
    const flightNumber = e.target.value;
    console.log('Flight Number:', flightNumber);
    // Perform any actions based on the flight number input
  };

  return (
    <div className="flight-selector" style={{ marginTop: '50px', marginLeft: '100px' }}>
      <label htmlFor="flightInput">Input Flight Number:</label>
      <div className="custom-input">
        <input
          type="text"
          id="flightInput"
          placeholder="Enter flight number"
          onChange={handleFlightInputChange}
          style={{ marginTop: '10px', padding: '80px', width: '200px' }}
        />
      </div>
    </div>
  );
};

export default FlightInput;
